from PySide6.QtWidgets import (
    QWidget,
    QGridLayout,
    QSizePolicy,
    QStyle,
    QStyleOption,
)
from PySide6.QtCore import Qt
from PySide6.QtGui import QPainter
from pathlib import Path
from .graphic import Graphic


class Section3(QWidget):

    def __init__(self, parent=None):
        super().__init__(parent)

        self.setObjectName("RightSection")
        self.setSizePolicy(QSizePolicy.Policy.Expanding, QSizePolicy.Policy.Expanding)

        self.load_style_sheet()
        self.setup_ui()

    def setup_ui(self):
        self.main_layout = QGridLayout(self)
        self.main_layout.setContentsMargins(0, 0, 0, 0)
        self.main_layout.setSpacing(20)

        # body widgets setup can be added here

        self.per_base_sequence_quality_image = "data:image/png;base64,"

        for i in range(9):
            graphic = Graphic("Per base sequence quality", self.per_base_sequence_quality_image, self)
            self.main_layout.addWidget(graphic, i // 3, i % 3)

        """ self.per_base_sequence_quality = Graphic("Per base sequence quality", self.per_base_sequence_quality_image, self)
        self.main_layout.addWidget(self.per_base_sequence_quality, 2, 2) """

        self.setLayout(self.main_layout)

    def load_style_sheet(self):
        styles_path = Path(__file__).parent / "right_section.qss"
        if styles_path.exists():
            with open(styles_path, "r") as styles:
                self.setStyleSheet(styles.read())

    def paintEvent(self, event):
        opt = QStyleOption()
        opt.initFrom(self)
        p = QPainter(self)
        self.style().drawPrimitive(QStyle.PE_Widget, opt, p, self)
